import React from 'react'
import Footer from './Footer'
import Header from './Header'
import ItemCard from './ItemCard'
import "./Projets.css"

function Projets() {
    return (
        <div>
            <div className="headerWrapper">
                <Header activetab={2}/>
                {/*
                <video autoplay="autoplay" loop>
                <source src="misouah.mp4" type="video/mp4"/>
                </video>*/}

                <div className="backBanner">
                <img alt="banner" src="./Image27.png"/>
                </div>
            </div>

            <div className="body">
                <div className="yellowBox">
                    <h1>LISTES DE PROJETS EN COURS</h1>
                </div>
                <div className="listBox">
                    <ItemCard 
                    image="./Image27.png" 
                    imageOrder={1} 
                    details={
                        {
                            "spanText": "Construction d’une citée de",
                            "colorText": "200 villas à Toumodi Rombo",
                            "detailText": "Détails de la villa :",
                            "colorClass": "yellowText"

                        }
                    }

                    detailsOrder={2}/>
                    <ItemCard 
                    image="./Image27.png" 
                    imageOrder={1} 
                    details={
                        {
                            "spanText": "Construction d’une citée de",
                            "colorText": "00 villas et plus à Dabou Pass II",
                            "detailText": "Détails de la villa :",
                            "colorClass": "yellowText"

                        }
                    }

                    detailsOrder={2}/>
                    <ItemCard 
                    image="./Image27.png" 
                    imageOrder={1} 
                    details={
                        {
                            "spanText": "Construction de",
                            "colorText": "villas de haut standing à Abatta près du programme de la MUGEFCI",
                            "detailText": "Détails de la villa :",
                            "colorClass": "yellowText"

                        }
                    }

                    detailsOrder={2}/>
                    <ItemCard 
                    image="./Image27.png" 
                    imageOrder={1} 
                    details={
                        {
                            "spanText": "Vente de",
                            "colorText": "terrains viabilisés à Abatta",
                            "detailText": "Détails de la villa :",
                            "colorClass": "yellowText"

                        }
                    }

                    detailsOrder={2}/>
                </div>
            </div>

            <Footer/>
        </div>
    )
}

export default Projets
